import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import BlurOn from '@material-ui/icons/BlurOn';

import './TopNav.scss';

class TopNav extends Component {
  render() {
    return(
      <nav>
        <ul>
          <li>Home</li>
          <li>Other</li>
          <li>Other2</li>
          <li>Other3</li>
          <li>Logo</li>
          <li>date</li>
          <li>icon</li>
          <li>burger icon</li>

        </ul>
      </nav>
    );
  }
}

export default TopNav;
